INSERT INTO media (mediaId, type, name, originalLanguage, adult, releaseDate, overview, backdropPath, posterPath, trailerLink, tmdbRating,  status) VALUES(324, true, 'Neighbours', 'en', False, '1985-03-18',  'Neighbours is an Australian television soap opera.  The show''s storylines concern the domestic and professional lives of the people who live and work in Erinsborough, a fictional suburb of Melbourne, Victoria. The series primarily centres around the residents of Ramsay Street, a short cul-de-sac, and its neighbouring areas, the Lassiters complex, which includes a bar, hotel, cafe, news office and park. Neighbours began with three families created by Watson – the Ramsays, the Robinsons and the Clarkes. Watson said that he wanted to show three families who are friends living in a small street. The Robinsons and the Ramsays had a long history and were involved in an ongoing rivalry.', 'https://image.tmdb.org/t/p/original/5khu4KsMY7glFIeKY3jFnI3x6PX.jpg', 'https://image.tmdb.org/t/p/original/bXY78bQsKCIiD17Sr6yO4wLIXqS.jpg', 'None', 6.7, 'Returning Series') ON CONFLICT DO NOTHING;
