INSERT INTO media (mediaId, type, name, originalLanguage, adult, releaseDate, overview, backdropPath, posterPath, trailerLink, tmdbRating,  status) VALUES(502, true, 'Late Night with Conan O''Brien', 'en', False, '1993-09-13',  'Late Night with Conan O''Brien is an American late-night talk show hosted by Conan O''Brien that aired 2,725 episodes on NBC between 1993 and 2009. The show featured varied comedic material, celebrity interviews, and musical and comedy performances. Late Night aired weeknights at 12:37 am Eastern/11:37 pm Central and 12:37 am Mountain in the United States. From 1993 until 2000, Andy Richter served as O''Brien''s sidekick; following his departure, O''Brien was the show''s sole featured performer. The show''s house musical act was The Max Weinberg 7, led by E Street Band drummer Max Weinberg.
