The Colbert Report has been nominated for seven Primetime Emmy Awards each in 2006, 2007, 2008, 2009, 2010, 2011, and 2012, two Television Critics Association Awards Awards, and two Satellite Awards. In 2013, it won two Emmys. It has been presented as non-satirical journalism in several instances, including by the Tom DeLay Legal Defense Trust and by Robert Wexler following his interview on the program. The Report received considerable media coverage following its debut on October 17, 2005, for Colbert''s coining of the term "truthiness", which dictionary publisher Merriam-Webster named its 2006 Word of the Year.', 'https://image.tmdb.org/t/p/original/Ajku4m7jbMpCTEPr794Imv19mCA.jpg', 'https://image.tmdb.org/t/p/original/pn2CVXjOlR8kY5MgOTJjZ71IM0Q.jpg', 'None', 6.9, 'Ended') ON CONFLICT DO NOTHING;
